import React, { Component } from "react";
import "./App.scss";

class App extends Component {
  state = {};
  render() {
    return (
      <div className>
      <header className="App">
        <h1 className="title1">Hello</h1>
      </header>
      <body>
        <h1 className="title1">Hello</h1>
      </body>
      </div>
    );
  }
}

export default App;
